    // console.log(this.numberFixedAfterPoint(106.53, 1));
    // console.log(this.numberFixedAfterPoint(106.589, 2));
    // console.log(this.numberFixedAfterPoint(106, 3));
    // console.log(this.numberFixedAfterPoint(-106.53, 4));
    // console.log(this.numberFixedAfterPoint(0, 5));
    numberFixedAfterPoint: function (num, bit) {
        var _num = num.toFixed(bit + 1);
        return _num.substr(0, _num.length - 1)
    },
    //根据经纬度查找城市
    findCity: function (Lo, La) {
        var lo = "";
        var la = "";
        var numlo = 0;
        var numla = 0;
        var aa = this.data.citylist[0].P;
        var temp = {};
        var temp1 = {};
        for (var i = 0; i < aa.length; i++) {
            //直辖
            if (aa[i].C.N) {
                lo = aa[i].C.D[0].Lo;
                la = aa[i].C.D[0].La;
                numlo = this.numberFixedAfterPoint(parseFloat(lo), 1);
                numla = this.numberFixedAfterPoint(parseFloat(la), 1);
                if (Lo === numlo && La === numla) {
                    //返回值
                    temp.directCity = true;
                    temp.indexProvince = i;
                    temp.province = aa[i].C.N;
                    return temp;
                }
            }
            //省份
            else {
                temp1 = aa[i].C;
                for (var j = 0; j < temp1.length; j++) {
                    try {
                        lo = temp1[j].D[0].Lo;
                        la = temp1[j].D[0].La;
                        numlo = this.numberFixedAfterPoint(parseFloat(lo), 1);
                        numla = this.numberFixedAfterPoint(parseFloat(la), 1);
                        if (Lo === numlo && La === numla) {
                            //返回值
                            temp.directCity = false;
                            temp.indexProvince = i;
                            temp.indexCity = j;
                            temp.province = aa[i].N;
                            temp.city = temp1[j].D[0].N;
                            temp.longitude = Lo;
                            temp.latitude = La;
                            // return temp;
                        }
                    }
                    catch (e) {
                        console.log(e, temp1[j])
                    }
                }
            }
        }
    },
